    return ( 
        <Container>
            <Row>
                <Col>
                    <h1>Hola, soy la descripcion</h1>
                </Col>
            </Row>
            <Row>
                <Col>
                    Hola
                </Col>
            </Row>
        </Container>
     );
}

export default Description;
